Lightning fast, scalable, cross-platform server side MVC Framework for .NET designed for rapid application development.

(Open-Source https://github.com/jitcoder/radmvc)

Documentation is pending (will add 9/12/2015) but the basics are:

1.       Create empty web application in visual studio
2.       In package manager console type in “install-package radmvc”
3.       Create folder called “Views”
4.       Create index.html inside Views
5.       Add Home class

Using RadMVC;
 
Public Class Home : Controller
{
  HtmlView Index()
  {
    return new HtmlView(“~/index.html”)
  }
}
